              </Typography>

              <WhiteTextTypography variant="h3">
                  This text should be white
              </WhiteTextTypography>




              <Box sx={{mt:3}}>
                  <Button sx={{}} variant="contained">Hello World</Button>
              </Box>


          </Box>
      </Container>

    </div>
  );
}

export default App;
